	add("mall", "{\"term\":\"mall\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027mail\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large heavy wooden beetle; a mallet for driving anything with force; a maul\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A heavy blow\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An old game played with malls or mallets and balls. See pall mall\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A place where the game of mall was played\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A public walk; a level shaded walk\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Southe\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Part of the area was laid out in gravel walks, and planted with elms; and these convenient and frequented walks obtained the name of the City \u0027\u0027Mall\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A pedestrianised street, especially a shopping precinct\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"pedestrian \u0027\u0027mall\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Alexander Garvin, \u0027The American City: What Works, What Doesn′t\u0027, %22malls%22+pedestrian+-intitle:%22mall|malls%22+-inauthor:%22mall%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d0HynT-2mC6mHmQWi3rXhBA\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22malls%22%20pedestrian%20-intitle%3A%22mall|malls%22%20-inauthor%3A%22mall%22\u0026amp;f\u003dfalse page 179\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"America′s first pedestrianized shopping \u0027\u0027mall\u0027\u0027 opened in 1959 in Kalamazoo, Michigan. Like most later pedestrian \u0027\u0027malls\u0027\u0027, it was intended to revive what everybody thought was a decaying downtown\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"An enclosed shopping centre\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Ralph E. Warner, \u0027Get a Life: You Don′t Need a Million to Retire Well\u0027, %22malls%22+-intitle:%22mall|malls%22+-inauthor:%22mall%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGXWnT4vIO-yUmQWpn9XhBA\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"%22malls%22%20-intitle%3A%22mall|malls%22%20-inauthor%3A%22mall%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Every day, at about the time the rest of us go to work, groups of retirees gather at many of America′s enclosed shopping \u0027\u0027malls\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Greg Holden, \u0027Starting an Online Business For Dummies\u0027, %22malls%22+-intitle:%22mall|malls%22+-inauthor:%22mall%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGXWnT4vIO-yUmQWpn9XhBA\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22malls%22%20-intitle%3A%22mall|malls%22%20-inauthor%3A%22mall%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"In addition to Web site kits, ISPs, and businesses that specialize in Web hosting, online shopping \u0027\u0027malls\u0027\u0027 provide another form of Web hosting\", \"priority\":19}]}, \"synonyms\":{}}");

	add("malo", "{\"term\":\"malo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|mal|o|lang\u003deo}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"malolactic fermentatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Joseph LaVilla, \u0027The Wine, Beer, and Spirits Handbook\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Allowing a wine to undergo \u0027\u0027malo\u0027\u0027 also protects it from bacterial contamination later\", \"priority\":3}]}, \"synonyms\":{}}");

	add("malt", "{\"term\":\"malt\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027mealt\u0027 \u0027malt\u0027 from Proto-germanic {{m|gem-pro|*maltą}}. Cognate with Dutch \u0027mout\u0027 German \u0027malz\u0027 Swedish \u0027malt\u0027 The Proto-Germanic noun is likely a borrowing from Proto-slavic {{m|sla-pro|*malta}}; compare Ukrainian \u0027sc\u003dcyrl\u0027 Czech \u0027mláto\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Malted grain (usually barley), used in brewing and otherwise\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Malt liquor, especially malt whisky\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1896\u0027\u0027, w:A. E. A. E. Housman, \u0027A Shropshire Lad\u0027, LXII\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Oh many a peer of England brew\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Livelier liquor than the Muse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And \u0027\u0027malt\u0027\u0027 does more than Milton ca\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"To justify God\u0027s ways to man\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Short for \u0026quot;malted milk shake\u0026quot;, a milkshake with malted milk powder added for flavo\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Maltose-rich sugar derived from malted grain\", \"priority\":9}]}, \"synonyms\":{}}");

