	add("malacology", "{\"term\":\"malacology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"French \u0027malacologie\u0027 contraction of \u0027malacozoologie\u0027 from the (obsolete) taxonomic name \u0027malacozoa\u0027 + French \u0027-ologie\u0027 (-ology) \u0027\u0027 (malacozoa) being in turn from Ancient greek (to 1453) \u0027μαλακός\u0027 (soft) + \u0027ζῷον\u0027 (animal)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of molluscs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, Richard Owen, \u0027Memoir on the Pearly Nautilus\u0027, [https://books.google.com.au/books?id\u003dwEgDAAAAQAAJ\u0026amp;pg\u003dPA2\u0026amp;dq\u003d%22malacology%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22malacology%22\u0026amp;f\u003dfalse page 2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"But the circumstances which the Baron Cuvier† so justly adduces as tending to retard the progress of \u0027\u0027Malacology\u0027\u0027 in general, seem especially to have contributed to obscure the history of \u0027Nautilus Pompilius\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, William King, \u0027A Monograph of the Permian Fossils of England\u0027, 2014, [https://books.google.com.au/books?id\u003d1KqTBQAAQBAJ\u0026amp;pg\u003dPA201\u0026amp;dq\u003d%22malacology%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22malacology%22\u0026amp;f\u003dfalse page 201\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"their chronogeny will long remain one of the most difficult problems in \u0027\u0027Malacology\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Galina A. Klevezal, M.V. Mina, \u0027Recording Structures of Mammals\u0027, [https://books.google.com.au/books?id\u003duMLSbxq0cBYC\u0026amp;pg\u003dPA231\u0026amp;dq\u003d%22malacology%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22malacology%22\u0026amp;f\u003dfalse page 231\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The first steps in the age determination of mammals by the number of annual layers were made when, in ichthyology and \u0027\u0027malacology\u0027\u0027, it has already become to routine practice to use annual layers for ageing animals and for back-calculating the growth of individuals\", \"priority\":10}]}, \"synonyms\":{}}");

