	add("malady", "{\"term\":\"malady\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027maladie\u0027 from Old french (842-ca. 1400) \u0027maladie\u0027 (sickness, illness, disease) from \u0027malade|lang\u003dfro\u0027 () from Latin \u0027male habitus|lang\u003dla\u0027 () 1st century AD. See also \u0027\u0027 and \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any ailment or disease of the body; especially, a lingering or deep-seated disorder\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The maladies of the body may prove medicines to the mind. \u0027Buckminster\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A moral or mental defect or disorder\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Love\u0027s a malady without a cure. \u0027Dryden\", \"priority\":4}]}, \"synonyms\":{}}");

