	add("malaise", "{\"term\":\"malaise\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"French\"], \"text\":\"From the French \u0027malaise\u0027 (ill ease) from \u0027mal\u0027 (bad) + \u0027aise\u0027 (ease) Compare \u0027ill at ease\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of general bodily discomfort, fatigue or unpleasantness, often at the onset of illness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An ambiguous feeling of mental or moral depression\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ill will or hurtful feelings for others or someone\", \"priority\":3}]}, \"synonyms\":{}}");

