	add("malapropism", "{\"term\":\"malapropism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the name of \u0027Mrs. Malaprop\u0027, a character in the play \u0027w:The Rivals|The Rivals\u0027 (1775) by w:Richard Brinsley Sheridan|Richard Brinsley Sheridan + \u0027-ism\u0027. As dramatic characters in English comic plays of this time often had allusive names, it is likely that Sheridan fashioned the name from \u0027malapropos\u0027 () Mrs. Malaprop is perhaps the best-known example of a familiar comedic character archetype who unintentionally substitutes inappropriate but like-sounding words that take on a ludicrous meaning when used incorrectly.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The blundering use of an absurdly inappropriate word or expression in place of a similar sounding one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The script employed \u0027\u0027malapropism\u0027\u0027 to great effect\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An instance of this; malaprop\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The translator matched every \u0027\u0027malapropism\u0027\u0027 in the original with one from his own language\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The humor comes from all the \u0027\u0027malapropisms\", \"priority\":5}]}, \"synonyms\":{}}");

