	add("malatang", "{\"term\":\"malatang\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\"], \"text\":\"From Mandarin chinese {{zh-l|麻辣燙|tr\u003dmálàtàng}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of hot, spicy soup of meat and vegetables, commonly eaten as a street food in China\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Tom Crawford, \u0027The Temple on Monday\u0027 (ISBN 0910055726), page 78\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Korean crab is small, that\u0027s all there is to it, but the red-pepper soup it\u0027s cooked in is like Chinese \u0027\u0027malatang\u0027\u0027. Meaning it burns you both ways and somehow you\u0027re thankful for the pain\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, \u0027汉语常用关联词语学习手册\u0027, page 5\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Boss Zhang went to the Sichuan restaurant for \u0027\u0027malatang\u0027\u0027 (a Sichuan dish) again. After the \u0027\u0027malatang\u0027\u0027, he went for Karaoke. And then he continued to play mah-jong with friends\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, \u0027Lonely Planet Shanghai\u0027 (ISBN 1743216238\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"steamers, noisy kebab sellers and red-cheeked \u0027\u0027malatang\u0027\u0027 (spicy soup with meat and vegetables) vendors\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Joe Remesz, \u0027From Canada to Philippines: Nonsense Novel\u0027 (ISBN 1475991282), page 177\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;First on the menu the birds have prepared a delicious bird nest soup and then we can enjoy \u0027\u0027malatang\u0027\u0027, other stuff, and a dish of fish.\u0026quot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Simon Lewis, \u0027The Rough Guide to Beijing\u0027 (ISBN 1409351742\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Among faddish foodies, Yunnan cuisine from China\u0027s far south has recently become popular, as has \u0027\u0027malatang\u0027\u0027 from Sichuan – a kind of dry hotpot\", \"priority\":11}]}, \"synonyms\":{}}");

	add("malawi", "{\"term\":\"malawi\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Chichewa\"], \"text\":\"Said to be from Chichewa {{m|ny|malawi||flames}}, after the appearance of the sunrise over Lake Malawi; also possibly from \u0027\u0027Maravi\u0027\u0027, the name of an early Malawi tribe, or from an old name for a lake. Chosen by {{w|Hastings Banda}} in 1964.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Country in Southern Africa. Official name: Republic of Malawi\", \"priority\":1}]}, \"synonyms\":{}}");

