	add("malcolm", "{\"term\":\"malcolm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"Royal name in Scotland, anglicised from \u0027Mael Coluim\u0027 \u0026quot; devotee of (Saint) Columba\u0026quot;.\u0026lt;ref\u0026gt;Patrick Hanks and Flavia Hodges: A Concise Dictionary of Firtys Names. Oxford University Press 2001.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Act I, Scene IV\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We will establish our estate upo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Our eldest, \u0027\u0027Malcolm\u0027\u0027, whom we name hereafte\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Prince of Cumberland\", \"priority\":4}]}, \"synonyms\":{}}");

	add("maldison", "{\"term\":\"maldison\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The pesticide malathion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, Victorian Department of Agriculture, \u0027The Journal of the Department of Agriculture of Victoria\u0027, Volumes 75-76, [http://books.google.com.au/books?id\u003diuFCAQAAIAAJ\u0026amp;q\u003d%22maldison%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22maldison%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnGKnT6OfOeSMmQX6wrDhBA\u0026amp;redir_esc\u003dy page 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Our tests have shown that the \u0027\u0027maldison\u0027\u0027/grain bait may be mixed well in advance, if it is then stored in drums or\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, R. H, Blank, D.S. Bell, M. H. Olson, \u0027Insecticide baits for control of the black field cricket (Teleogryllus commodus)\u0027, \u0027New Zealand Journal of Experimental Agriculture\u0027, Volume 13, [http://books.google.com.au/books?id\u003dsOtt6Q2vHT0C\u0026amp;pg\u003dPA267\u0026amp;dq\u003d%22maldison%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnGKnT6OfOeSMmQX6wrDhBA\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22maldison%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 267\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The sawdust \u0027\u0027maldison\u0027\u0027 mixture appeared to be more effective in paddocks with short pasture than in long rank pasture\", \"priority\":6}]}, \"synonyms\":{}}");

	add("maldives", "{\"term\":\"maldives\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0026quot;Malé Islands\u0026quot;, from Malé, the name of the main island (of uncertain etymology), plus \u0027-diva, -dive\u0027, \u0026quot;island\u0026quot;, probably related to Sanskrit द्वीप (dvīpa) \u0026quot;island\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An island country in South Asia. Official name: Republic of the Maldives\", \"priority\":1}]}, \"synonyms\":{}}");

