	add("maler", "{\"term\":\"maler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Malto, meaning \u0026quot;hill people\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A people of northern India who speak the Malto language\", \"priority\":1}]}, \"synonyms\":{}}");

	add("maleducation", "{\"term\":\"maleducation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|mal|education|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Education that is faulty or incomplete\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, Nelson Louis Bossing, \u0027Principles of Secondary Education\u0027, [https://books.google.com.au/books?id\u003drw25AAAAIAAJ\u0026amp;q\u003d%22maleducation%22%7C%22maleducations%22\u0026amp;dq\u003d%22maleducation%22%7C%22maleducations%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daLygVf6DMcblmAWltoD4DA\u0026amp;ved\u003d0CDQQ6AEwBA page 212\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Far more important than correcting faulty education resulting from the activities of the nonschool educative agencies is preventing, where possible, such \u0027\u0027maleducation\u0027\u0027 from taking place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, \u0027Report of Proceedings of the Commonwealth Foundation\u0027, [https://books.google.com.au/books?id\u003dB3UaAAAAMAAJ\u0026amp;q\u003d%22maleducation%22%7C%22maleducations%22\u0026amp;dq\u003d%22maleducation%22%7C%22maleducations%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daLygVf6DMcblmAWltoD4DA\u0026amp;ved\u003d0CD4Q6AEwBg page 7\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Education is a continuous process which, unless maintained, soon lapses into the state of \u0027\u0027maleducation\u0027\u0027. There are many people who have had the benefit of university education, who are today living specimens of \u0027\u0027maleducation\u0027\u0027 because they have ceased to educate themselves\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Ultramontane Associates, \u0027Culture Wars\u0027, Volume 19, [https://books.google.com.au/books?id\u003dKQnZAAAAMAAJ\u0026amp;q\u003d%22maleducation%22%7C%22maleducations%22\u0026amp;dq\u003d%22maleducation%22%7C%22maleducations%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daLygVf6DMcblmAWltoD4DA\u0026amp;ved\u003d0CFEQ6AEwCw page 49\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Not only is Afrocentrism spawning grotesque \u0027\u0027maleducation\u0027\u0027, multiculturalism is exacerbating racial hostilities, undoing earlier racial progress\", \"priority\":7}]}, \"synonyms\":{}}");

	add("maleness", "{\"term\":\"maleness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|male|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being male; masculinity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("malengine", "{\"term\":\"malengine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027mal engin\u0027 Middle french (ca. 1400-1600) \u0027mal engin\u0027 from \u0027mal\u0027 () + \u0027engin\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Evil intent, bad intention; fraud, deceit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Book VII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I dare sey for good love she bade us to dyner and nat for no \u0027\u0027male engyne\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, \u0027\u0027, III.i\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the chaste damzell, that had neuer priefe / Of such \u0027\u0027malengine\u0027\u0027 and fine forgerie, / Did easily beleeue her strong extremitie\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1641\u0027\u0027, \u0027Of Reformation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"for when the protector\u0027s brother, Lord Sudley, the admiral, through private malice and \u0027\u0027mal-engine\u0027\u0027 was to lose his life, no man could be found fitter than Bishop Latimerto divulge in his sermon the forged accusations laid to his charge\", \"priority\":7}]}, \"synonyms\":{}}");

	add("malesub", "{\"term\":\"malesub\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|male|sub|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male submissive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("malfatti", "{\"term\":\"malfatti\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From the Italian\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of hand-rolled dumpling, or gnocch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Category:en:Pasta\", \"priority\":2}]}, \"synonyms\":{}}");

	add("malfeasance", "{\"term\":\"malfeasance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027malfaisance\u0027, derived from \u0027malfaire\u0027, \u0027maufaire\u0027 (“do evil”), from Latin \u0027malefaciō\u0027 (i do evil) from \u0027male\u0027 (evilly) + \u0027faciō\u0027 (do, make)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"wrongdoin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Misconduct or wrongdoing, especially by a public official that causes damage\", \"priority\":2}]}, \"synonyms\":{}}");

	add("malfortune", "{\"term\":\"malfortune\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"misfortune\", \"priority\":1}]}, \"synonyms\":{}}");

	add("malfunction", "{\"term\":\"malfunction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027mal-\u0027 (bad, incorrect) + \u0027function\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"faulty functionin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"failure to function\", \"priority\":2}]}, \"synonyms\":{}}");

	add("malian", "{\"term\":\"malian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Mali|an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person from Mali or of Malian descent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("malice", "{\"term\":\"malice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) from Latin \u0027malitia\u0027 (badness, bad quality, ill-will, spite) from \u0027malus\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Intention to harm or deprive in an illegal or immoral way. Desire to take pleasure in another\u0027s misfortune\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, w:Philip K. Philip K. Dick, \u0027Valis\u0027, ISBN 0-553-20594-3, page 67\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"not only was there no gratitude (which he could psychologically handle) but downright \u0027\u0027malice\u0027\u0027 showed itself instead\", \"priority\":3}]}, \"synonyms\":{}}");

	add("malignancy", "{\"term\":\"malignancy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|malignant|cy|lang\u003den}} or {{suffix|malign|ancy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being malignant or diseased\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A malignant cancer; specifically, any neoplasm that is invasive or otherwise not benign\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which is malign; evil, depravity, malevolence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027malignancy\u0027\u0027 of my fate might perhaps distemper yours\", \"priority\":5}]}, \"synonyms\":{}}");

	add("maligner", "{\"term\":\"maligner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|malign|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who maligns\", \"priority\":1}]}, \"synonyms\":{}}");

	add("maliseet", "{\"term\":\"maliseet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"mi\u0027kmaq\"], \"text\":\"From a Mi\u0027kmaq term meaning \u0026quot;broken talkers\u0026quot;—the Mi\u0027kmaq perceived the Maliseet as speaking a broken version of Mi\u0027kmaq.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of an Algonquian-speaking Native American people of the , indigenous to the Saint John River valley and its tributaries, crossing the borders of New Brunswick and Quebec in Canada, and Maine in the United States\", \"priority\":1}]}, \"synonyms\":{}}");

	add("malison", "{\"term\":\"malison\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027malison\u0027 from Latin {{m|la|maledictiō}}, from the past participle stem of {{m|la|maledīcō||I speak ill of}}, from \u0027male\u0027 (wickedly, badly) + {{m|la|dīcō||say, speak}}. Compare \u0027malediction\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A curse\", \"priority\":1}]}, \"synonyms\":{}}");

	add("malkin", "{\"term\":\"malkin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Diminutive of Malde, an early form of Maude or Matilda. Compare \u0027grimalkin\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A (stereotypical name for a) lower-class or uncultured woman; a kitchenmaid; a slattern\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1385\u0027\u0027, \u0027Piers Plowman\u0027, I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ȝe ne haue na more meryte · in masse ne in houres / Þan \u0027\u0027Malkyn\u0027\u0027 of hire maydenhode · þat no man desireth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A mop, especially one used to clean a baker\u0027s oven\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027, \u0027s:An Antidote Against An Antidote Against Atheism\u0027, Book III, A Collection of Several Philosophical Writings of Dr. Henry More, p. 120\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;She had no sooner said so, but they all vanished saving onely one \u0027Peter Grospetter\u0027, whom a little after she saw snatch\u0027d up into the aire, and to let fall his \u0027\u0027Maulkin\u0027\u0027 (a stick that they make clean Ovens withall) and her self was also driven so forcibly with the wind, that it made her almost Lose her breath.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A mop or sponge attached to a jointed staff for swabbing out a cannon\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A scarecrow\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A cat\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Now she was strong enough to walk and watch them circling in the sky or to sit in the arbour at the end of the long lawn and, with the sunlight smouldering in her dark-red hair and lying wanly over the area of her face and neck, watch the multiform and snow-white convolutions of her \u0027\u0027malkins\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A hare\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Water Music\u0027, Penguin 2006, p. 158\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"There was milk punch and spiced whisky, a smell of goose and \u0027\u0027maukin\u0027\u0027 roasting on the spit\", \"priority\":13}]}, \"synonyms\":{}}");

	add("malkoha", "{\"term\":\"malkoha\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the cuculine birds in the \u0027Phaenicophaeus\u0027 genus, found across southern and south-east Asia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mallard", "{\"term\":\"mallard\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) \u0027malarde\u0027 \u0027mawdelare\u0027 from Old french (842-ca. 1400) \u0027malart\u0027 \u0027mallart\u0027 (wild duck) possibly derived from the Old high german (ca. 750-1050) \u0027madelhart\u0027 {{gloss|whence the English forms \u0027maudelard\u0027 \u0027mawdelard\u0027 }; or alternatively from \u0027male\u0027 \u0027malle\u0027 (male) {{suffix||ard|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A common and widespread dabbling duck, \u0027Anas platyrhynchos\u0027, whose male has a distinctive dark green head\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mallcore", "{\"term\":\"mallcore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mall|core|lang\u003den}}, since it may be played as background music in shopping centres.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"popular Popular music that is overproduced, mainstream, corporately controlled, etc., as opposed to popular music that is independent or artistic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Ian Christe, \u0027Sound of the beast\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a time when the hardcore scene badly needs to overthrow the \u0027\u0027mallcore\u0027\u0027 bands, the naughty yet non-threatening pop punk groups who wear their tattoos like designer labels instead of inner scars\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"nu metal.\u0026lt;ref\u0026gt;[http://dictionary.reference.com/browse/mallcore Mallcore : Dictionary]\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Tommy Udo, Brave Nu World, 2002, Sanctuary Publishing, page 16, ISBN: 1-86074-415-X\u0026lt;/ref\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Munson the Destroyer, \u0027WHY DO PEOPLE LIKE TO HATE SLIPKNOT\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Troves of angst-ridden, mall-invading teens adopted Slipknot as their patron-saint back in 1999 (when the band’s self-titled debut came out), instantly earning the band a “mallcore” seal of disapproval by their critics\", \"priority\":6}]}, \"synonyms\":{}}");

	add("malleableness", "{\"term\":\"malleableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|malleable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being malleable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mallee", "{\"term\":\"mallee\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"woiwurrung\"], \"text\":\"From Woiwurrung \u0027mali\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of scrubland with low-growing thick eucalypts, characteristic of certain parts of Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any semi-desert region of Australia where such scrub is the predominant vegetation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, EO Schlunke, \u0027The Village Hampden\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"‘They\u0027re going to lynch you, Regerson,’ Harry told him, grinning. ‘You\u0027d better take to the \u0027\u0027mallee\u0027\u0027 before they come for you\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Illywhacker\u0027, Faber and Faber 2003, p. 365\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It made no difference that he had also invented several ploughs and a device for grubbing \u0027\u0027Mallee\u0027\u0027 country or that people had journeyed all the way from Melbourne to inspect them\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any of several low-growing eucalypts characteristic of such scrubland, especially , and\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The growth habit of certain eucalypt species that grow with multiple stems springing from an underground lignotuber, shared by species of related genera\", \"priority\":8}]}, \"synonyms\":{}}");

	add("mallemaroking", "{\"term\":\"mallemaroking\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Dutch\"], \"text\":\"Generally considered to derive from Dutch although a specific etymon in unclear. \u0027Century\u0027 and some other old dictionaries derive it from a confusion of two similar Dutch words, namely {{m|nl|*mallemerok||foolish woman}} (from {{m|nl|mal|malle|foolish}} + {{m|nl|*marok}}, from French {{m|fr|marotte||jester\u0027s sceptre}}) and {{m|nl|*mallemok||sailor of a whaling vessel}}, but the first of those words is not attested\u0026lt;!--or does not seem to be...--\u0026gt;, and the second is not attested with the claimed meaning (but see {{m|en|mollymawk}}). Compare {{m|nl|mallemolen}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Carousing on icebound Greenland whaling ships\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027\u0026lt;!--?--\u0026gt;, \u0027Punch\u0027, volume 235, page 319\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Just because I had one gin before and a couple of glasses of claret during you thought I\u0027d been \u0027\u0027mallemaroking\u0027\u0027.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Katrin Maria Kohl, ‎Ritchie Robertson, \u0027A History of Austrian Literature 1918-2000\u0027, page 243\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"they were willing to endure so much physical hardship out of loyalty to Emperor Franz Joseph. Indeed, such is their sense of duty that they even indulge in some muted \u0027\u0027mallemaroking\u0027\u0027 to celebrate the Emperor\u0027s birthday\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mallet", "{\"term\":\"mallet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 \u0027lang\u003dfro|maillet\u0027 () diminutive of \u0027lang\u003dfro\u0027 \u0027lang\u003dfro|mail\u0027 () from Latin \u0027lang\u003dla|malleus\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of hammer with a larger than usual head made of wood, rubber or similar non-iron material, used by woodworkers for driving a tool, such as a chisel. A kind of maul\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A weapon resembling the tool, but typically much larger\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1786\u0027\u0027, Francis Grose, \u0027A Treatise on Ancient Armour and Weapons\u0027, page 51\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Mallet\u0027\u0027 of arms, according to the representation of it given by Father Daniel, exactly resembles the wooden instrument of that name, now in use, except in the length of the handle, it was like the hammer of arms, to be used with both hands, indeed it differed very little from that weapon in its form\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A light beetle with a long handle used in playing croquet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The stick used to strike the ball in the sport of polo\", \"priority\":6}]}, \"synonyms\":{}}");

	add("malleus", "{\"term\":\"malleus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027malleus\u0027 (hammer, mallet)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The small hammer-shaped bone of the middle ear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fracture of the \u0027\u0027malleus\u0027\u0027 handle is a rare traumatic middle ear lesion\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Elaine N. Marieb \u0026amp; Katja Hoehn, \u0027Human Anatomy \u0026amp; Physiology\u0027, 8th edition, page 57\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The tympanic cavity is spanned by the three smallest bones in the body: the auditory ossicles These bones, named for their shape, are the \u0027\u0027malleus\u0027\u0027 (malʹe-us; \u0026quot;hammer\u0026quot;); the incus (ingʹkus; \u0026quot;anvil\u0026quot;); and the stapes (staʹpēz; \u0026quot;stirrup\u0026quot;). The \u0026quot;handle\u0026quot; of the \u0027\u0027malleus\u0027\u0027 is secured to the eardrum, and the base of the stapes fits into the oval window\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The tripus (\u0027ossicle in cypriniform fishes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One of the paired calcareous structures within the mastax of rotifers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1884\u0027\u0027, Hudson, C.T., \u0027Memoirs: An Attempt to re-classify the Rotifers\u0027 in \u0027Quarterly Journal of Microscopical Science 1884 s2-24\u0027, pages [http://jcs.biologists.org/cgi/reprint/s2-24/95/335.pdf 335-356\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"in the typical mastax of a Brachionus there are two hammer-like bodies (\u0027\u0027mallei\u0027\u0027), which work on a kind of split anvil (incus); [...] each \u0027\u0027malleus\u0027\u0027 consists of an upper part or head (uncus) and a lower or handle (manubrium\", \"priority\":8}]}, \"synonyms\":{}}");

	add("mallorca", "{\"term\":\"mallorca\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The main island of the Balearic Islands (Spain) in the Mediterranean Sea. Also spelt Majorca\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mallow", "{\"term\":\"mallow\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|malue}}, from Old english (ca. 450-1100) \u0027mealwe\u0027 from Latin \u0027malva\u0027 Compare \u0027mauve\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of flowering plants in several genera of the taxonomic family \u0027Malvaceae\u0027, especially of the genus \u0027Malva\u0027. Several species are edible by humans\", \"priority\":1}]}, \"synonyms\":{}}");

